    useEffect(() => {
        const fetchResults = async () => {
            try {
                const response = await fetch('http://localhost:8000/results');
                if (!response.ok) {
                    const errorText = await response.text(); // Get response text for better error messages
                    throw new Error(`Failed to fetch results: ${response.status} - ${errorText}`);
                }
                const data = await response.json();
                // Extract the results from the response
                const formattedResults = data.results; // Assuming results is already an array of objects
                setResults(formattedResults);
    
                // Set totals directly
                setTotals(data.totals);
            } catch (err) {
                setError((err as Error)?.message || 'An unknown error occurred');
                console.error('Error fetching results:', err);
            }
        };
    
        fetchResults();
    }, []);
    

